    public static boolean patternMatch(String s1, String s2) {
        // loop through each string
        // ensure that characters match, or are wild cards
        // if no match, return false
        // once done looping, return true

        int j = 0;
        char currentChar;
        if (s1 != null && s2 != null) {
            for(int i = 0; i < s1.length(); i++) {
                //check whether number of letter
                // if letter, compare with s2
                //    if not same char, return false
                //    else, continue
                // else if number, increment our s2 index by that number, and attempt to continue
                currentChar = s1.charAt(i);
                if(Character.isAlphabetic(currentChar)) {
                    if (j >= s2.length() || s1.charAt(i) != s2.charAt(j)) {
                        return false;
                    }
                    j++;
                } else {
                    String value = "";
                    while (i < s1.length() && !Character.isAlphabetic(s1.charAt(i))) {
                        value += s1.charAt(i);
                        i++;
                    }
                    i--;

                    System.out.println(currentChar + " " + j);
                    j += Integer.parseInt(value);
                    System.out.println(j);

                    if (j > s2.length()) {
                        return false;
                    }
                }

            }
            return j == s2.length();
        }

        return false;
    }

